import FadeLine from '~/components/FadeLine.vue'
import MenuIcon from '~/components/MenuIcon.vue'
import DesktopNav from '~/components/DesktopNav.vue'
export default {
    name:'Header',
    components:{
    FadeLine,
    MenuIcon,
    DesktopNav,
    },
    methods:{
        sendEvent(){
            this.$emit('toggleDrawer')
        }
    },
    props:{
        isMobile: {
            type: Boolean,
            default: false
        },
        isDrawerOpen: {
            type: Boolean,
            default: false
        }
    }
}
